import React from 'react';

const  BookSingle = (props) => {
    return (
        <><h4>Selected Book</h4>
 
        <div className="row">
            <div className="col s12">
                <div className="card hoverable">
                    <div className="card-image">
                        <img src="books.jpeg"/>
                        <span className="card-title">{props.books.name}</span>
                    </div>
                    <div className="card-content">
                        <p class="card-panel teal lighten-2" >
                            Author Name: {props.books.author}
                        </p>
                        <p>
                            Total Pages: {props.books.page}
                        </p>
                        <p>
                            Book Price: {props.books.price}
                        </p>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}
 
export default BookSingle;
